var title_f14_28_14797="Khorana score";
var content_f14_28_14797=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F73002&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F73002&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Khorana score for estimating venous thromboembolism risk in patients with cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"5\" width=\"20%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"5\">",
"        Khorana score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\" colspan=\"2\">",
"        Risk factor",
"       </td>",
"       <td class=\"subtitle2\" colspan=\"3\">",
"        Points",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"5\">",
"        Site of primary tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"2\">",
"        Very high risk (stomach, pancreas)",
"       </td>",
"       <td class=\"sublist_other_centered\" colspan=\"3\">",
"        2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"2\">",
"        High risk (lung, lymphoma, gynecologic, bladder, testicular)",
"       </td>",
"       <td class=\"sublist_other_centered\" colspan=\"3\">",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"2\">",
"        All other sites",
"       </td>",
"       <td class=\"sublist_other_centered\" colspan=\"3\">",
"        0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Prechemotherapy platelet count &ge;350,000/microL",
"       </td>",
"       <td class=\"centered\" colspan=\"3\">",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Hemoglobin level &lt;10 g/dL or use of ESAs",
"       </td>",
"       <td class=\"centered\" colspan=\"3\">",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\">",
"        Prechemotherapy WBC &gt;11,000/microL",
"       </td>",
"       <td class=\"centered\" colspan=\"3\">",
"        1",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"2\">",
"        BMI &ge;35 kg/m",
"        <sup>",
"         2",
"        </sup>",
"       </td>",
"       <td class=\"centered\" colspan=\"3\">",
"        1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"5\">",
"        Incidence of VTE based on Khorana score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Khorana score points",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         Derivation cohort",
"         <sup>",
"          [1]",
"         </sup>",
"        </p>",
"        VTE risk after 2.5 months",
"       </td>",
"       <td>",
"        <p>",
"         Validation cohort",
"         <sup>",
"          [1]",
"         </sup>",
"        </p>",
"        VTE risk after 2.5 months",
"       </td>",
"       <td>",
"        <p>",
"         Independent cohort",
"         <sup>",
"          [2]",
"         </sup>",
"        </p>",
"        VTE risk after six months",
"       </td>",
"       <td>",
"        <p>",
"         Patients in phase I trials",
"         <sup>",
"          [3]",
"         </sup>",
"        </p>",
"        VTE risk after two months",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         0 (low)",
"        </strong>",
"       </td>",
"       <td>",
"        0.8 percent",
"       </td>",
"       <td>",
"        0.3 percent",
"       </td>",
"       <td>",
"        1.5 percent",
"       </td>",
"       <td>",
"        1.5 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         1 to 2 (intermediate)",
"        </strong>",
"       </td>",
"       <td>",
"        1.8 percent",
"       </td>",
"       <td>",
"        2 percent",
"       </td>",
"       <td>",
"        3.8 percent (1 point); 9.6 percent (2 points)",
"       </td>",
"       <td>",
"        4.8 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         &ge;3 (high)",
"        </strong>",
"       </td>",
"       <td>",
"        7.1 percent",
"       </td>",
"       <td>",
"        6.7 percent",
"       </td>",
"       <td>",
"        17.7 percent",
"       </td>",
"       <td>",
"        12.9 percent",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The Khorana score was developed from a cohort of 2701 patients with cancer receiving a first course of chemotherapy to predict the cumulative incidence of VTE at 2.5 months",
"    <sup>",
"     [1]",
"    </sup>",
"    . The score was validated in a cohort of 1365 patients, most of whom (91 percent) had an ECOG performance status of 0 or 1. The score was tested independently in 819 patients with newly diagnosed cancer or cancer progression who had not received chemotherapy within the preceding three months to predict the cumulative incidence of VTE at six months",
"    <sup>",
"     [2]",
"    </sup>",
"    ; and in 1415 patients enrolled in phase I clinical trials followed for a median of two months",
"    <sup>",
"     [3]",
"    </sup>",
"    .",
"    <div class=\"footnotes\">",
"     ESAs: erythropoiesis-stimulating agents; VTE: venous thromboembolism; WBC: white blood cell; BMI: body mass index.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Khorana AA, Kuderer NM, Culakova E, et al. Development and validation of a predictive model for chemotherapy-associated thrombosis. Blood 2008; 111:4902.",
"       </li>",
"       <li>",
"        Ay C, Dunkler D, Marosi C, et al. Prediction of venous thromboembolism in cancer patients. Blood 2010; 116:5377.",
"       </li>",
"       <li>",
"        Mandala M, Clerici M, Corradino I, et al. Incidence, risk factors and clinical implications of venous thromboembolism in cancer patients treated within the context of phase I studies: the 'SENDO experience'. Ann Oncol 2012; 23:1416.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
